import React from "react";
import Action from "../Action";

const MorePanel = () => {
  return (
    <div className="more-panel">
      <Item name="fa-gear" />
    </div>
  );
};

const Item = (props) => {
  return (
    <div className="more-panel-item">
      <Action name={props.icon} size="fa-xl" />
      <span>{props.name}</span>
    </div>
  );
};

export default MorePanel;
